import styled from "styled-components";
//import { Button } from 'antd'

const Background = styled.div`
    background: black;
    opacity: 80%;
    display: absolute;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
`

const Cover = () => {
    return(
        <Background>
            <h1>Welcome.</h1>
            <button>Come in!</button>
        </Background>
    )
}

export default Cover;
